css:
atom-text-editor,
:host,
atom-text-editor .gutter,
:host .gutter {
  background-color: #2b2b2b;
  color: #e6e1dc;
}
atom-text-editor .cursor,
:host .cursor {
  border-color: #ffffff;
}
atom-text-editor .highlights .region,
:host .highlights .region {
  background-color: #474d5c;
}
atom-text-editor .line-number.cursor-line-no-selection,
:host .line-number.cursor-line-no-selection,
atom-text-editor .line.cursor-line,
:host .line.cursor-line {
  background-color: rgba(255, 255, 255, 0.050000000000000044);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(255, 255, 255, 0.09999999999999998);
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(255, 255, 255, 0.09999999999999998);
}
.comment {
  font-style: italic;
  color: #bc9458;
}
.keyword,
.storage {
  color: #cc7833;
}
.entity.name.function,
.keyword.other.name-of-parameter.objc {
  color: #ffc66d;
}
.entity.name {
  color: #ffffff;
}
.constant.numeric {
  color: #a5c261;
}
.variable.language,
.variable.other {
  color: #d0d0ff;
}
.constant {
  color: #6d9cbe;
}
.variable.other.constant {
  color: #da4939;
}
.constant.language {
  color: #6d9cbe;
}
.string {
  color: #a5c261;
}
.support.function {
  color: #da4939;
}
.support.type {
  color: #6d9cbe;
}
.support.constant {
  color: #a5c261;
}
.meta.tag,
.declaration.tag,
.entity.name.tag,
.entity.other.attribute-name {
  color: #e8bf6a;
}
.invalid {
  color: #ffffff;
  background-color: #990000;
}
.constant.character.escaped,
.constant.character.escape,
.string .source,
.string .source.ruby {
  color: #519f50;
}
.markup.inserted {
  color: #e6e1dc;
  background-color: #144212;
}
.markup.deleted {
  color: #e6e1dc;
  background-color: #660000;
}
.meta.diff.header,
.meta.separator.diff,
.meta.diff.index,
.meta.diff.range {
  background-color: #2f33ab;
}
